import React, { PureComponent } from "react";
import {
  Radar,
  RadarChart,
  PolarGrid,
  PolarAngleAxis,
  PolarRadiusAxis,
} from "recharts";
import Data from "../Data/DimensionContent";

const data = Data;

export default class Example extends PureComponent {
  static jsfiddleUrl = "https://jsfiddle.net/alidingling/6ebcxbx4/";

  render() {
    return (
      <RadarChart outerRadius={150} width={600} height={340} data={data}>
        <PolarGrid />
        <PolarAngleAxis
          dataKey="subject"
          font-family="Prompt"
          width={200}
          hight={40}
        />
        <PolarRadiusAxis angle={30} domain={[-100, 100]} />
        <Radar
          font-family="Prompt"
          name="บริบท"
          dataKey="d0"
          stroke="#ff5252"
          fill="#ff5252"
          fillOpacity={0.6}
        />
      </RadarChart>
    );
  }
}
